const axios = require("axios")

async function getValueConverted(data) {
    console.log(data);
    return axios({
        method: "get",
        url:"http://localhost:4000/unitConvertor",
        body : data
    }).then(res => {
        console.log("response--->",res.body);

    })
}
exports.getValueConverted = getValueConverted
